Here's what I did, it works. Is there a better way?

```def Catalan_tuple(n):
    if n < 1:
        n = 1
    c = [1]
    for i in range(n-1):
        list_Catalan = 0
        for x in range(i+1):

            list_Catalan += c[x] * c[i - x]
        c.append(list_Catalan)
    return tuple(c)
n = int(input('Please enter a length for n: '))
print(Catalan_tuple(n))```

